import React from "react";
import styles from "./Cart.module.css";
import Modal from "../UI/Modal";

function Cart(props) {
  const cartMeals = (
    <ul className={styles["cart-meals"]}>
      {[{ id: "c1", name: "Sushi", amount: 2, price: 12 }].map((meal) => (
        <li>{meal.name}</li>
      ))}
    </ul>
  );

  return (
    <Modal>
      {cartMeals}
      <div className={styles.total}>
        <span className={styles.total}>Total Amount</span>
        <span className={styles.amount}>35</span>
      </div>
      <div className={styles.actions}>
        <button className={styles["close-button"]}>Close</button>
        <button className={styles["order-button"]}>Order</button>
      </div>
    </Modal>
  );
}

export default Cart;
